import React, { useEffect, useState } from "react";
import { useDispatch, useSelector } from "react-redux";
import { getAllKyc } from "../../../actions/adminActions";
import AdminAllKyc from "../../../components/AdminKyc/AdminAllKyc";
import "./AdminKyc.css";

const AdminKyc = () => {
  const dispatch = useDispatch();
  const kyc = useSelector((state) => state.allKyc);

  const [ed, setEd] = useState('');

  console.log(kyc);

  useEffect(() => {
    dispatch(getAllKyc());
  }, []);

  return (
    <div className="kyc">
      Kyc
      <div className="kyc-box">
        {" "}
        <div className="top">
          <button className="bnt" onClick={() => setEd("kycReq")}>
            Kyc request
          </button>
          <button className="bnt" onClick={() => setEd("acceptedKyc")}>
            Accepted Kyc
          </button>
          <button className="bnt" onClick={() => setEd("block")}>
            Rejected Kyc
          </button>
        </div>
      </div>

      <div className="bottom">
        {ed === "kycReq" ? (
        <AdminAllKyc />
      ) : ed === "employer" ? (
        {/* <AllEmployers /> */}
      ) : ed === "block" ? (
        <BlockedUsers />
      ) : (
        ""
      )}
        </div>
    </div>
  );
};

export default AdminKyc;
